import React, { useEffect, useState } from "react";
import axios from "axios"

function Users() {

    const [users, setusers] = useState([]);

    useEffect(()=> {
        const fetchAllUsers = async () => {
            try {
                const res = await axios.get("https://localhost:3000/users")
                console.log(res)
            }

            catch(err) {
                console.log(err)
            }
        } 

        fetchAllUsers()
    },[])


    return (
        <div>
            <h1>Hello</h1>
        </div>
    )
}

export default Users
